window.bookSummaryJSON = "<p>A place written out of history. A world off the edge of the map.&nbsp;</p> <p>In this fantasy adventure trilogy, Sienna and the Mapwalker team must defend Earthside from the invasion of the Borderlanders and face their darkest challenge against the Shadow.</p> <p><i>Map of Shadows</i></p> <p>When her Grandfather is murdered under mysterious circumstances, Sienna Farren inherits his map shop in the ancient city of Bath, England. She discovers that her family is bound up with the Ministry of Maps, a mysterious agency who maintain the borders between this world and the Uncharted.<br> <br> With help from her friends, Sienna discovers her own magical ability and a terrifying place of blood that awaits in the world beyond.</p> <p>But when she discovers a truth about her past and the Borderlands begin to push through the defenses, Sienna must join the team of Mapwalkers on their mission to find the Map of Shadows - whatever the cost.</p> <p><i>Map of Plagues</i></p> <p>When a fragment of a deadly map is recovered from a medieval plague pit in London, the Mapwalker team must cross over into the Borderlands once more.</p> <p>In a race against time, they must find the remaining pieces of the map in a journey across long-lost cities before the Shadow Cartographers wield it against Earthside in a devastating attack.</p> <p><i>Map of the Impossible</i></p> <p>As natural disasters sweep Earthside, a mutant army rises in the Borderlands, driven by the dark force behind the Shadow Cartographers. Sienna and the Mapwalker team must use the Map of the Impossible to journey through the realm of the dead and face the nightmare at its heart.</p> <p>But when one of their number is taken and the team begins to break apart, each Mapwalker must face their greatest challenge.</p> <p>Can the Mapwalkers reach the Tower of the Winds before the Shadow claims Earthside?<br> Will Sienna choose Finn - or turn away from the Borderlands forever?</p> <p><i>Contains the complete series of portal fantasy novels.</i></p>"; 
